import { useState } from "react";
import "./App.css";

function App() {
  const [text, setText] = useState("")

  return (
    <div>
       <form onSubmit={() => alert("Submitting")}>
      <input type="text" value={text} onChange={e => setText(e.target.value)} />
      <input type="button" value="Submit" />
      </form>
    </div>
  );
}

export default App;
